<!DOCTYPE html>
<html id="i-module-ui" lang="en" dir="ltr">
<head>
<meta charset="utf-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/animate.css/4.1.1/animate.min.css"/>

<link rel="stylesheet" href="rangeslider.css"><!--interface stylesheet-->
</head>
<body>

<!--HEADER-->
<header id="ui-header"><!--Header Fixed-->
<button class="button black-contrast back sm-btn" onclick="closeImoduleFrame()"></button>
<button id="i-module-name" class="button black sm-btn not-btn not-mobile" style="color:#868787"></button>
<button id="i-section-name" class="button black sm-btn not-btn"></button>
<button class="button black sm-btn menu" title="Learning Menu" onclick="document.getElementById('i-menu').classList.add('show');"></button>
</header><!--End Header-->
<!--HEADER END-->

<!--MENU OVERLAY-->
<aside id="i-menu">
</aside>
<!--MENU OVERLAY END-->


<!-- CONTENT -->
<div id="i-content"><!--Learning Content Container-->
</div><!--End Learning Content Container-->
<!-- CONTENT END -->

<!--FOOTER-->
<footer id="ui-footer">
<button id="i-step-back" class="button nav-btn return" onclick="">step back</button>
<button id="i-forward" class="button nav-btn forward disabled-btn" onclick="">next section</button>
</footer>
<!--FOOTER END-->
